import { Col, Row } from "react-bootstrap";
import "../styling/hero.css";
import imgLeft from "../assets/hero-left.jpg";
import imgRight from "../assets/hero-right.jpg";

export const Hero = () => {
  return (
    <div className="hero">
      <Row>
        <Col sm={12} md={6} className="column-left">
          <figure>
            <img src={imgLeft} alt="hero-left" />
          </figure>
        </Col>
        <Col sm={12} md={6} className="column-right">
        <img src={imgLeft} alt="hero-left" />
        </Col>
      </Row>
    </div>
  );
};
